    private static String basePath="/usr/local/upload/";
    public static void traverFile(File file){
        new ImageJ().addListen();
        if(file.isDirectory()){
            File[]list=file.listFiles();
            for(File f:list)
                traverFile(f);
        }else{
            String fileName=file.getName();
            int index=fileName.lastIndexOf(".");

            String suffix=null;
            if(index==-1)
                return;
            suffix=fileName.substring(fileName.lastIndexOf("."));
            String regex="png|jpeg|jpg|png|tif";
            Pattern pattern=Pattern.compile(regex);
            Matcher matcher=pattern.matcher(suffix);
            System.out.println(fileName+"___"+suffix);
            if(matcher.find()){
                String realPath=file.getParent();
                System.out.println("reallength:"+realPath.length()+"__"+basePath.length());
                if(realPath.length()+1==basePath.length())
                    realPath="";
                else
                    realPath=realPath.substring(basePath.length());
                String pathTemp="coverPic/"+realPath+"/";
                path=basePath+pathTemp;
                File f=new File(path);
                System.out.println("======================tempPath:"+realPath+"____"+pathTemp+"_____"+path);
                if(!f.exists()){
                    System.out.println("文件'"+path+"'不存在,创建状态:"+f.mkdirs());
                }
                loadingFile(file.getAbsolutePath(),needChange);
                System.out.println("=================tempPath:"+realPath+"____"+pathTemp+"_____"+path);
            }
        }
    }


